import React, { Component } from "react";
import Button from "react-bootstrap/Button";
export default class Card extends Component {
  state = {};
  componentDidMount = () => {};
  constructor(props) {
    super();
  }
  render() {
    const mystyle = {
      margin: "0.5%",
      padding: "0.5%",
      width: "10%",
      height: "20cm",
      color: "white",
      backgroundColor: "gray",
      fontFamily: "Arial",
    };
    return <Button style={mystyle}>{this.props.val}</Button>;
  }
}
